import React from 'react';
import './ImageChangeOnMouseOver.css';

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <img src="/static/dog1.jpg" alt="" />
            &nbsp;&nbsp;&nbsp;
            <img src="/static/dog2.jpg" alt="" />
        </div>
    );
};

export default ImageChangeOnMouseOver;
